import { TextField, Box, Button } from "@mui/material";
import ClearIcon from "@mui/icons-material/Clear";

export default function SearchForm() {
    return (
        <div className="centered-form-container">
            <div className="centered-form">
                <TextField variant="outlined" size="small" placeholder="TID or XTID" className="text-field" sx={{ mr: 2 }} fullWidth autoFocus />
                <Button variant="contained" size="small" color="primary" className="submit-button">
                    Find!
                </Button>
            </div>
        </div>
    );
}
